thousand = ''
greatestnow = 0
currproduct = 1
counter = 0
numofterms = 0
divide = 1
for i in thousand:
    num = int(i)
    if num != 0:
        currproduct *= num
    numofterms += 1
    # keep track of numbers to divide by 
    counter += 1
    # keep track of greatest product until now
    if currproduct > greatestnow:
        greatestnow = currproduct
    # for every 5 terms
    if numofterms == 5:
        # reset numofterms to 4 for next set of five terms
        numofterms = 4
        divide = int(thousand[counter -5])
        if divide != 0:
            # divide currproduct by the 5th term of the last set of 5 terms
            currproduct = currproduct // divide
        # if number is 0
        else:
            # reset currproduct and numofterms
            currproduct = 1
            numofterms = 0   
print(greatestnow)
    
        
    
    
